import React from "react";
import { Link } from "react-router-dom";
import { Navbar, Container, NavbarBrand } from "react-bootstrap";

const Header = () => {
  return (
    <Navbar bg="light">
      <Container>
        <Navbar.Text>
          {" "}
          <Link to="/">stremas</Link>
        </Navbar.Text>

        <div style={{ float: "right" }}>
          <Link to="/"> all stremas</Link>
        </div>
      </Container>
    </Navbar>
  );
};
export default Header;
